import React from "react";
import './profileComponent.css';
import {useDispatch, useSelector} from "react-redux";
import { getUsersFetch} from '../redux/actions/sagaActions'

const ProfileComponent = () => {


    const dispatch = useDispatch();
    const users = useSelector(state => state.myFirstReducer.users);

    const profiles = useSelector((state) => state.allProfiles.profiles)
    const {name, phone, email, website} = profiles[0];

    console.log("here are the users: ", profiles )
    return (
        <div className="card"> 
            <button onClick={() => dispatch(getUsersFetch())}> Get Users </button>
            <div> Users: {profiles.map((user=> (<div>{user.name}</div>)))}</div>
            <div className="avatar">
                <img src="./avatar.svg" alt="avatar" className="profile__image"/>
            </div>
            <div className="profileinfo">
                <div className="profile__name"> {name} </div>
                <div className="profile__email"> <span className="material-icons">email</span>{email} </div>
                <div className="profile__phone"> <span className="material-icons">call</span> {phone} </div>
                <div className="profile__website"> <span className="material-icons">language</span> {website} </div> 
            </div>
            <div className="buttons">
                <button className="likePost"><span style={{fontSize: "13px"}} className="material-icons">favorite_border</span></button>
                <button className="editPost"><span style={{fontSize: "13px"}} className="material-icons">edit</span></button>
                <button className="deletePost"><span style={{fontSize: "13px"}} className="material-icons">delete</span></button>
            </div>
        </div> 
    );
};


export default ProfileComponent;
